"use strict";(self.webpackChunkwaxdevelopers=self.webpackChunkwaxdevelopers||[]).push([[3628],{5574:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2023/05/19/What_is_Antelope","metadata":{"permalink":"/waxdevelopers_test/blog/2023/05/19/What_is_Antelope","editUrl":"https://github.com/3dkrender/waxdeveloper_test/tree/main/blog/2023-05-19-What_is_Antelope.md","source":"@site/blog/2023-05-19-What_is_Antelope.md","title":"What is Antelope and how is it related to EOSIO?","description":"Antelope is a community-led blockchain protocol that has forked from EOSIO 2.0. It is an open framework for building fast, secure, next-generation decentralized applications (dApps) and Web3 services. Antelope has been created through a coalition of four EOSIO protocol-based blockchains (EOS, Telos, WAX, and UX Network). These chains share Antelope\'s underlying blockchain codebase and work together to accelerate the development of the core protocol. With its public Github repository and website, Antelope introduces a more advanced framework as an independent blockchain.","date":"2023-05-19T00:00:00.000Z","formattedDate":"May 19, 2023","tags":[{"label":"Antelope","permalink":"/waxdevelopers_test/blog/tags/antelope"},{"label":"EOSIO","permalink":"/waxdevelopers_test/blog/tags/eosio"},{"label":"EOS","permalink":"/waxdevelopers_test/blog/tags/eos"},{"label":"Telos","permalink":"/waxdevelopers_test/blog/tags/telos"},{"label":"WAX","permalink":"/waxdevelopers_test/blog/tags/wax"},{"label":"UX Network","permalink":"/waxdevelopers_test/blog/tags/ux-network"},{"label":"Blockchain","permalink":"/waxdevelopers_test/blog/tags/blockchain"},{"label":"dApps","permalink":"/waxdevelopers_test/blog/tags/d-apps"},{"label":"DeFi","permalink":"/waxdevelopers_test/blog/tags/de-fi"},{"label":"NFTs","permalink":"/waxdevelopers_test/blog/tags/nf-ts"}],"readingTime":1.97,"hasTruncateMarker":true,"authors":[{"name":"Marcos DK","title":"3DK Render Guild Founder","link":"https://3dkrender.com","image_url":"https://3dkrender.com/wp-content/uploads/2020/07/MarcosDK_.jpg","imageURL":"https://3dkrender.com/wp-content/uploads/2020/07/MarcosDK_.jpg"}],"frontMatter":{"title":"What is Antelope and how is it related to EOSIO?","authors":{"name":"Marcos DK","title":"3DK Render Guild Founder","link":"https://3dkrender.com","image_url":"https://3dkrender.com/wp-content/uploads/2020/07/MarcosDK_.jpg","imageURL":"https://3dkrender.com/wp-content/uploads/2020/07/MarcosDK_.jpg"},"description":"Antelope is a community-led blockchain protocol that has forked from EOSIO 2.0. It is an open framework for building fast, secure, next-generation decentralized applications (dApps) and Web3 services. Antelope has been created through a coalition of four EOSIO protocol-based blockchains (EOS, Telos, WAX, and UX Network). These chains share Antelope\'s underlying blockchain codebase and work together to accelerate the development of the core protocol. With its public Github repository and website, Antelope introduces a more advanced framework as an independent blockchain.","tags":["Antelope","EOSIO","EOS","Telos","WAX","UX Network","Blockchain","dApps","DeFi","NFTs"],"image":"/img/blog/antelope.jpg"}},"content":"<head>\\r\\n  <meta property=\\"keywords\\" content=\\"Antelope, EOSIO, EOS, Telos, WAX, UX Network, Blockchain, dApps, DeFi, NFTs\\" />\\r\\n  <meta property=\\"description\\" content=\\"Antelope is a community-led blockchain protocol that has forked from EOSIO 2.0. It is an open framework for building fast, secure, next-generation decentralized applications (dApps) and Web3 services. Antelope has been created through a coalition of four EOSIO protocol-based blockchains\\" />\\r\\n</head>\\r\\n\\r\\nAntelope is a community-led blockchain protocol that has forked from EOSIO 2.0. It is an open framework for building fast, secure, next-generation decentralized applications (dApps) and Web3 services. Antelope has been created through a coalition of four EOSIO protocol-based blockchains: EOS, Telos, WAX, and UX Network. These chains share Antelope\'s underlying blockchain codebase and work together to accelerate the development of the core protocol. With its public Github repository and website, Antelope introduces a more advanced framework as an independent blockchain.\\r\\n\\r\\n\x3c!-- truncate --\x3e\\r\\n\\r\\n## Benefits of Antelope being a community-led protocol\\r\\n\\r\\nAs a community-led protocol, Antelope offers several benefits:\\r\\n\\r\\n1. **Decentralization**: Antelope is decentralized, ensuring that no single entity controls the protocol. This promotes transparency and enhances security.\\r\\n\\r\\n2. **Collaboration**: Antelope is developed by a coalition of EOSIO protocol-based blockchains, including EOS, Telos, WAX, and UX Network. This collaboration fosters continuous improvement and evolution of the core protocol.\\r\\n\\r\\n3. **User-centric Approach**: Antelope is built by its users, for its users. The community has a say in the protocol\'s development, ensuring that it meets their needs and requirements.\\r\\n\\r\\n4. **Advanced Framework**: Antelope\'s SDKs and scalability provide web3 developers with an opportunity to build dApps on a highly advanced protocol. The focus on technical improvements and creating a useful blockchain architecture benefits everyone involved.\\r\\n\\r\\n5. **Low-cost Accessibility**: Antelope aims to be a low-cost, open framework and high-throughput blockchain. It enables anyone interested in creating and publishing next-generation web3 services and dApps to participate.\\r\\n\\r\\n## Examples of decentralized applications that can be built on Antelope\\r\\n\\r\\nAntelope provides an open framework for building various decentralized applications, including:\\r\\n\\r\\n- DeFi protocols\\r\\n- NFT platforms\\r\\n- Blockchain games\\r\\n- Supply chain management solutions\\r\\n- Social media platforms\\r\\n- Identity verification systems\\r\\n\\r\\nWith its decentralized and user-centric approach, Antelope empowers developers to create innovative dApps that leverage the advanced features and scalability of the protocol.\\r\\n\\r\\n**Start building your next-generation dApp on Antelope and join the decentralized revolution!**\\r\\n\\r\\n:::note\\r\\n* [_dApps_]: Decentralized Applications\\r\\n* [_DeFi_]: Decentralized Finance\\r\\n* [_NFTs_]: Non-Fungible Tokens\\r\\n:::"}]}')}}]);